        super(props);
        this.clearConsole=this.clearConsole.bind(this);
    }

    renderLines(){
         return this.props.console.join("\n");
    }

    clearConsole(){
        console.log('clicked');
        this.props.console = [];
    }

    render(){
       return e(
            'textarea',
            {
                className:'console',
            },
            this.renderLines(),
        <Button onClick={this.clearConsole} label = "Clear"/>)
    }


}

export default Console;
